window.bookSummaryJSON = "<p><b>I tried to hide from the truth and that didn’t work.</b></p> <p><b>I tried to run from him and that definitely didn’t work.</b></p> <p>What was next for me but to try and work off my punishment? One that ended with me sacrificing my own heart the second his Lost Siren finally walked into his life; the one I found for him.</p> <p>I took this as my cue to leave. My cue to run and never look back. That had been the plan and he made a promise to let me go. A promise he quickly broke.</p> <p>Kaiden Wrath was not the type of Enforcer to let go of what he wanted and what he wanted was me, the author of his story.</p> <p>Now, the biggest question of all remained: would our ending be the happy ever after my heart hoped for or was it doomed to be a demon's tragedy?</p>"; 
